import React from 'react';

const Logo = ({ className = '' }) => {
  return (
    <div className={`flex items-center ${className}`}>
      <span className="text-3xl font-bold uppercase tracking-tight" style={{ color: '#EB422B' }}>
        DARE
      </span>
      <div 
        className="ml-1 px-2 py-1 transform rotate-1"
        style={{ 
          backgroundColor: '#EB422B',
          transform: 'rotate(2deg)',
        }}
      >
        <span className="text-3xl font-bold lowercase text-black">
          now
        </span>
      </div>
    </div>
  );
};

export default Logo;
